ume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"393466","type":"CustomJS"},{"attributes":{},"id":"393292","type":"Selection"},{"attributes":{},"id":"393613","type":"StringFormatter"},{"attributes":{},"id":"393500","type":"AllLabels"},{"attributes":{},"id":"393646","type":"StringEditor"},{"attributes":{},"id":"393619","type":"StringFormatter"},{"attributes":{},"id":"393644","type":"StringEditor"},{"attributes":{},"id":"393623","type":"StringFormatter"},{"attributes":{},"id":"393291","type":"UnionRenderers"},{"attributes":{"label":{"value":"Max Drawdown (-0.2%)"},"renderers":[{"id":"393274"}]},"id":"393294","type":"LegendItem"},{"attributes":{},"id":"393651","type":"StringFormatter"},{"attributes":{"editor":{"id":"393660"},"field":"Size","formatter":{"id":"393659"},"title":"Size"},"id":"393543","type":"TableColumn"},{"attributes":{},"id":"393605","type":"StringFormatter"},{"attributes":{},"id":"393652","type":"StringEditor"},{"attributes":{"factors":["0","1"],"palette":["rgb(178.5, 27.163043478260846, 0.0)","rgb(0.0, 178.5, 0.0)"]},"id":"393172","type":"CategoricalColorMapper"},{"attributes":{},"id":"393606","type":"StringEditor"},{"attributes":{},"id":"393636","type":"StringEditor"},{"attributes":{"data":{},"selected":{"id":"393292"},"selection_policy":{"id":"393291"}},"id":"393270","type":"ColumnDataSource"},{"attributes":{"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"393431","type":"Segment"},{"attributes":{},"id":"393639","type":"StringFormatter"},{"attributes":{"source":{"id":"393270"}},"id":"393275","type":"CDSView"},{"attributes":{},"id":"393648","type":"StringEditor"},{"attributes":{"data":{"Close":{"__ndarray__":"UrgeheuUr0AzMzMzszqwQKRwPQrX1K1Aw/UoXI9QrUBSuB6Fa6StQOF6FK5HdK9Aj8L1KNx6rkDhehSuR8quQEjhehSuvq5AZmZmZuYTrkD2KFyPQiuvQArXo3A9EK9AcT0K1+MDsECuR+F6VCGwQOxRuB6F569AcT0K1yPir0DXo3A
